import React from 'react';
import { useNavigate } from 'react-router-dom';
import { User } from 'lucide-react';

const Header = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/login');
  };

  const handleProfilePage = () => {
    navigate('/profile');
  };

  return (
    <div className="flex justify-end items-center relative">
      {/* Wrapping User icon and dropdown in one div with group */}
      <div className="relative group">
        <div className="cursor-pointer">
          <User size={40} className="text-white" />
        </div>

        {/* Dropdown remains visible on hover */}
        <div className="absolute right-0 mt-2 w-48 bg-white text-purple-600 rounded shadow-lg z-10 hidden group-hover:flex flex-col">
          <div
            className="px-4 py-2 hover:bg-gray-200 cursor-pointer"
            onClick={handleProfilePage}
          >
            Profile
          </div>
          <div
            className="px-4 py-2 hover:bg-gray-200 cursor-pointer"
            onClick={handleLogout}
          >
            Logout
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
